import Sculpture from "./Sculptures";
import Gallery from "./Gallery";
import Form from "./Form";
import './state.css';
const props = { 
 show: { 
  sculpture: false,
  gallery: false,
  form: true
 } 
};

const State = () => { 

 return (
   <div>
     {props.show.sculpture && <Sculpture />}
     {props.show.gallery && 
            <div className="Page">
            <Gallery />
            <Gallery />
          </div>

     }
     {props.show.form && <Form />}
   </div>
 );
};

export default State;
